def reverse_dna(dna):
    complementary_dna = ''
    for d in dna.lower():
        r = ''
        if d == 'a':
            r = 't'
        elif d == 't':
            r = 'a'
        elif d == 'g':
            r = 'c'
        elif d == 'c':
            r = 'g'
        complementary_dna += r
    return complementary_dna[::-1]

def start_pattern(pattern, dna):
    result = []
    l = len(pattern)
    for i in range(0, len(dna)):
        sub = dna[i:i+l]
        if sub == pattern:
            result.append(str(i))
    return result


def count_pattern(str, patt):
    result = 0
    l = len(patt)
    for i in range(0,len(str)):
        sub = str[i:i+l]
        if sub == patt:
            result += 1
    return result

def count_for_mer(str, mer_len):
    largerst = 0
    c = {}
    result = {}
    l = len(str)-mer_len
    for i in range(0, l):
        pattern = str[i:i+mer_len]
        c[pattern] = count_pattern(str, pattern)
        if largerst <= c[pattern]:
            largerst = c[pattern]

    for i in c:
        if c[i] == largerst:
            result[i] = c[i]
    return result

